import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
import './App.css';
import Signup from './pages/UserSignupForm';



function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path="" element="{<Signup/>}"/>
      </Routes>
      </Router>
      {/* <Signup/> */}
    </div>
  );
}

export default App;
